import React from 'react';
import "./addProd.css";
function AddProd(){
    return(
        <div className='producto'>
            
                <h2>Imagen del producto</h2>
                <label for="img">Select image:</label>
                <input type="file" id="img" name="img" accept="image/*"/>
            
        </div>
    );
}

export default AddProd;
